import './App.css';
import Main from './components/JobList';
import JobForm from './components/JobForm';
import Navbar from './components/Navbar';
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
        <header>
          <Navbar />
        </header>
        <body>
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/formulario" element={<JobForm />} />
          </Routes>
        </body>
  </>
);
}

export default App;
